INSERT INTO Relationships (
    ID,
    File_ID,
    Relationship_Type,
    Name,
    ID_Number,
    Date_of_Birth,
    Employment_Status,
    Gender,
    Created_By,
    Created_At,
    Updated_By,
    Updated_At,
    center_id
)
SELECT
    temp.id,
    ad.ID,
    CASE
        WHEN temp.relationship_text ~ '^[0-9]+$'
        THEN temp.relationship_text::integer
        ELSE NULL
    END AS relationship_type,
    temp.name,
    temp.id_number,
    temp.dob::date,
    temp.employment_status,
    CASE
        WHEN temp.gender = 'M' THEN 2
        WHEN temp.gender = 'F' THEN 1
        ELSE NULL
    END AS gender,
    'migration' AS created_by,
    now()       AS created_at,
    'migration' AS updated_by,
    now()       AS updated_at,
    ad.center_id
FROM (
    SELECT
        inner_temp.id,
        inner_temp.file_number,
        COALESCE(inner_temp.relationship::text, '') AS relationship_text,
        inner_temp.name,
